import React, { useState } from "react";
import BasicDetail from "../../components/BasicDetail/BasicDetail";
import Box from "@mui/material/Box";
import Stepper from "@mui/material/Stepper";
import Step from "@mui/material/Step";
import StepLabel from "@mui/material/StepLabel";
import './kyc.css'
import Address from "../../components/Address/Address";
import Btn from "../../components/Btn/Btn";

const CompleteKyc = () => {
  const steps = ["Basic Details", "Address details", "Other details"];
  const [step, setStep] = useState(0)
  const handleClick=()=>{
    setStep(step+1)
  }
  return (
    <div>
      <div className="stepper">
        <Box sx={{ width: "100%" }}>
          <Stepper activeStep={step} alternativeLabel>
            {steps.map((label) => (
              <Step key={label}>
                <StepLabel>{label}</StepLabel>
              </Step>
            ))}
          </Stepper>
        </Box>
      </div>
      <div className="kycDetail">

      {step===0?<BasicDetail/>:null}
      {step===1?<Address/>:null}
      </div>
      <div className="btn">

      <Btn label="Back" handleDec={handleDec}/>
      <Btn label="Next" type="submit" handleClick={handleClick}/>
      </div>
    </div>
  );
};

export default CompleteKyc;
